func snail(snailMap [][]int) []int {
	ans := make([]int, 0)
	dim := len(snailMap)
	for i := 0; i < (1 + (dim-1)*2); i++ {
		switch i % 4 {
		case 0:
			ans = append(ans, snailMap[0]...)
			snailMap = append(snailMap[1:])

		case 1:
			for i, row := range snailMap {
				ans = append(ans, row[len(row)-1])
				snailMap[i] = append(row[:len(row)-1])
			}
		case 2:
			ans = append(ans, reverseOrder(snailMap[len(snailMap)-1])...)
			snailMap = append(snailMap[:len(snailMap)-1])
		case 3:
			temp := []int{}
			for i, row := range snailMap {
				temp = append(temp, row[0])
				snailMap[i] = append(row[1:])
			}
			ans = append(ans, reverseOrder(temp)...)
		}
		/*
			if len(snailMap) == 0 {
				break
			}
		*/
	}
	return ans
}

func reverseOrder(s []int) []int {
	for i, j := 0, len(s)-1; i < j; i, j = i+1, j-1 {
		s[i], s[j] = s[j], s[i]
	}

	return s
}

